import React from 'react';

function SectionThree() {
  return (
    <section className="h-screen bg-gray-200 flex justify-center items-center snap-center scroll-smooth">
      <div className="p-8 max-w-4xl mx-auto">
        <h2 className="text-3xl font-bold">General Text Section</h2>
        <p className="mt-4">This is some general text content...</p>
      </div>
    </section>
  );
}

export default SectionThree;
